import React from "react"
import "./cards.css"

function CreateCard (props) {

    return(
        // we need to get the click set up and call a function
        <div className="card" onClick={() => console.log("Clicked on ID: " + props.id)}>
            <div className="img-container">
                <img alt={props.name} src={props.image} />
            </div>
        </div>
    )
}

export default CreateCard
